import React, {useEffect, useState} from 'react';
import './Circle.css';




const Circle = (props) => {

    let container = <div></div>;

    for (course in props.courses) {
        const courseContainer = <div>{course}</div>

        container.append(courseContainer);

    }

};

export default Circle;
